import React, {Component} from 'react'
import axios from "axios";
class DateSide extends Component{

    render() {
        return (
            <div className="RCA-manage-date-side">
                <h3 className="RCA-manage-title">
                    {this.props.selected} 강사 현황
                </h3>
            </div>
        )
    }
}

class ScheduleList extends Component{
    componentDidUpdate() {
        this.getAllschedule()
    }

    getAllschedule(){
        var cbox_0 = document.getElementById("RCA-manage-0");
        var cbox_1 = document.getElementById("RCA-manage-1");
        var cbox_2 = document.getElementById("RCA-manage-2");
        var cbox_3 = document.getElementById("RCA-manage-3");
        var cbox_4 = document.getElementById("RCA-manage-4");

        axios.get('/api/getselect/'+this.props.selected)
            .then(res=>
                res.data.forEach(function (item,index){
                    var content=document.createTextNode(item.name);
                    switch (item.task_num){
                        case 0:
                            cbox_0.appendChild(content);
                            break
                        case 1:
                            cbox_1.appendChild(content);
                            break
                        case 2:
                            cbox_2.appendChild(content);
                            break
                        case 3:
                            cbox_3.appendChild(content);
                            break
                        case 4:
                            cbox_4.appendChild(content);
                            break
                    }
                })
            );
    }
    render() {
        return (
            <div className="RCA-manage-schedule-list">
                <div id="RCA-manage-0">
                    <h2>지방</h2>
                </div>
                <div id="RCA-manage-1">
                    <h2>수도권</h2>
                </div>
                <div id="RCA-manage-2">
                    <h2>6차시</h2>
                </div>
                <div id="RCA-manage-3">
                    <h2>4차시</h2>
                </div>
                <div className="RCA-manage-adjustable" id="RCA-manage-4">
                    <h2>조정 가능</h2>
                </div>

            </div>
        )
    }
}

export default class Manage extends Component {

    render() {
        return (
            <div className="RCA-manage-container">
                <DateSide selected={this.props.selected}/>
                <ScheduleList selected={this.props.selected}/>
            </div>
        )
    }
}
